INSERT INTO `flights` VALUES (1,'Maleta de viaje con closet CLOSMAGIC 50%','<p>¿Al salir de viaje eres de los que amontonan todo cuando desempaca? Olvídate de eso con el práctico CLOSMAGIC, una maleta de viaje con clóset que te permitirá mantener todo en orden.<br></p>','2016-10-03','2016-10-23','61534','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33205/475770851fb936cc7924f6000bfc6cb2661e8ca2.full.jpg','92','Maleta,equipaje ,CLOSET ,VIAJE'),(2,'Made in México Ganadora Mejor Obra 60%','<p>¡Conquístala con una conmovedora y romántica puesta en escena interpretada por un gran elenco!</p>','2016-10-04','2016-10-09','48226','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33437/90d19c986606c66f27d654a068c7c08e4ec8f825.full.png','15','teatro,obras'),(3,'A Reir como Nunca en Como Quieras Perro ÁMAME 60%','<p>\"Como quieras... ¡Perro Ámame!\"\" es una Historia de Amor contada a través de la Música de tu vida.<br></p>\"','2016-10-04','2016-10-09','16825','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33440/5c9f301ca1b2ba30af6b066af51570b6c7189d07.full.png','56','comedia,teatro,boletos'),(4,'Porque no Hay Amor como el de ella ¡Mamá por Siempre! 60%','<p>¡Emociónate y Ríe en ésta amorosa comedia donde la realidad y la verdad no son lo mismo!</p><p></p>','2016-10-04','2016-10-09','49940','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33441/e0b282d196b07e386fabbdc6521df110cae15e8c.full.png','65','teatro,boletos,comedia,vip'),(5,'¡Ahora Foro Lucerna! Juego que Todos Jugamos Jodorowsky 60%','<p>¡Ven a jugar a ser tú y al mismo tiempo no serlo!</p><p></p>','2016-10-04','2016-10-09','87517','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33442/53e840321044520ddcd6a602ea21e25aae406375.full.png','37','Jodorowsky,teatro,lujan'),(6,'Extractor de jugos ¡Inicia con energía el día!','<p>Naranja, betabel, zanahoria ¡El sabor que se te ocurra lo podrás preparar con este extraordinario extractor de jugo!</p><p><br></p>','2016-10-04','2016-10-10','43125','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33398/987f9c2ae3358e95220fad47084b5f09a53d28b0.full.jpg','99','Extractor,Jugos'),(7,'Televisor MAKENA LED de 42 pulgadas ','<p>No hay nada como pasar una tarde en casa disfrutando de un buen programa de televisión, descansando de la rutina del trabajo o la escuela.&nbsp;</p><p>Con el televisor MAKENA LED de 42 pulgadas no te perderás ninguno de ellos.</p><br>','2016-10-04','2016-10-10','76462','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33399/8186dda706ba6285acba5095f599ed9d9adabdeb.full.jpg','78','Televisión'),(8,'Cortadora de pelo PHILIPS  ¡Luce un nuevo look!','<p>Consigue un afeitado perfectamente suave sin arañazos ni cortes. Solo tienes que colocar el accesorio para rasurar la cabeza y disfrutar siempre de un acabado perfecto.</p>','2016-10-04','2016-10-10','21999','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33401/7be60d4baed7cd2c923bf4e0bee8d2057086271a.full.jpg','76','Cortadora,Afeitadora'),(9,'Cafetera con Jarra de Vidrio Gaia 50%','Cafetera Gaia, ofrece una calidad excelente, tanto en su diseño como en el café. El espiral Aroma distribuye el café por la jarra para lograr un sabor óptimo en cada taza.','2016-10-04','2016-10-10','30420','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33402/2a4b13d202977bb4ca2e0d33b5366090ccaa0a82.full.png','5','cafetera'),(10,'Perfilador Facial Púrpura Philips 37%','<p>Olvídate de ese vello en la cara, desaparecelo en instantes con la cortadora de precisión Philips y elimina el vello facial que tanto te molesta. Es ideal para llevarla a donde quieras.</p><p><br></p>','2016-10-04','2016-10-10','62759','https://cuponassets.cuponatic-latam.com/backendMx/uploads/imagenes_descuentos/33404/935d52626c3837c4b02972e30e3c40aa9c65236a.full.